import React, {useEffect, useState} from 'react';
import Style from "./Questions.module.css";
import { Button } from '@mui/material';

const QuestionsModal = () => {
    let counter = 1;

    const handleSubmit = () => {
        counter += 1;
    }

    const questions = [
    {
        questionTitle: "What is the tallest mountain?",
        answers : {
            answer: "K2",
            answer: "Everest",
            answer: "Mt. Olympia",
            answer: "Pilot Butte",
        },
    },

  ];

    return (
        <div className={Style.modal}>
            <div className={Style.modal_inner}>
                <h3 className={Style.modal__inner__title}>Question {counter}</h3>

                {questions.map((el, i) => (
                    <h4 key={i + 1} className={Style.modal__inner__subtitle}>
                    {el.questionTitle}
                    </h4>
                ))}

                 <div className={Style.modal__inner__btn_container}>
                    {questions.answers.map((el, i) => (
                            <Button
                            key={i + 1}
                            className={Style.modal__inner__button}
                            variant="outlined"
                            color="secondary"
                        >
                            {el.answer}
                        </Button>

                    ))}

                </div>
            </div>
        </div>
    )
}

export default QuestionsModal
